Look at the arrow diagram of a discrete function f in Diagram 1.3. In this function, the elements in set X are mapped to a corresponding element in set Y respectively.
The elements in set X, are the values of x that can be substituted in f which is known as the domain whereas elements of set Y, are the possible obtained values of function f which is known as the codomain. The elements in set Y that are mapped from X, are the actual obtained values of function f is known as the range. Thus, we obtain
Domain = {1, 2, 3, 4} 
Codomain = {3, 5, 7, 9, 11} 
Range = {3, 5, 7, 9}
